if mibBuilder.loadTexts: newCodeAuthentViaTFTP.setDescription('Once mcontrolRestartAgent is set to loadAndExecuteNewAgent (3), PowerNet adapter will start to load the remote image file, for authentication only, instead of saving the code into flash memory. Only if a validNewAgentCodeImage (1) is found will the agent reboot the PowerNet adapter and invoke the loader to load and save new code into the flash memory. Otherwise, the current agent code will continue to run. This OID shows the result of the above authentication process. validNewAgentCodeImage (1) means the code image on TFTP server is a valid APC agent code and is different version from the current agent. Once agent identifies this, loader will start to update flash memory with the new agent code. sameAgentCodeImage (2) means the code image on TFTP server is exactly the same as the currently running agent. Currently running agent will not invoke loader to load the same again. invalidAgentCodeImage (3) means the code image on TFTP server is NOT a valid APC agent code. Thus, current agent will not load it into the flash memory. The value of this OID will be associated with TRAP codeImageAuthentDone. This OID is only supported by APC Network Management Cards.')
