if mibBuilder.loadTexts: mcontrolRestartAgent.setStatus('mandatory')
if mibBuilder.loadTexts: mcontrolRestartAgent.setDescription('Setting this OID to restartCurrentAgent (1) will restart the same SNMP agent code currently saved in flash memory. Setting this OID to loadAndExecuteNewAgent (3) will enable adapter to load a new agent code into the flash memory and start to execute this new agent code. Bootp/tftp is the default protocol. loadAndExecuteNewAgent is only supported by APC Network Management Cards. Setting this OID to restartWithoutAgent (4) will restart the system and not start the agent. The subsequent time the system restarts the agent will also automatically restart. Setting this OID to resetNetworkAndRestart (5) will set the Boot Mode, IP Address, Subnet Mask, and Default Gateway to defaults, expire any existing DHCP lease and then restart the system. Setting this OID to resetNetworkLeaveModeAndRestart (6) will leave the Boot Mode at the current setting, set the IP Address, Subnet Mask, and Default Gateway to defaults, expire any existing DHCP lease and then restart the system.')
