upsBasicControlConserveBattery = MibScalar((1, 3, 6, 1, 4, 1, 318, 1, 1, 1, 6, 1, 1), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2))).clone(namedValues=NamedValues(("noTurnOffUps", 1), ("turnOffUpsToConserveBattery", 2)))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: upsBasicControlConserveBattery.setStatus('mandatory')
if mibBuilder.loadTexts: upsBasicControlConserveBattery.setDescription("Setting this variable to turnUpsOffToConserveBattery(2) causes a UPS on battery to be put into 'sleep' mode. The UPS will turn back on when utility power is restored. Attempting to turn off a UPS that is not on battery will result in a badValue error. Setting this value to noTurnOffUps(1) has no effect. The value noTurnOffUps(1) will always be returned when the variable is read.")
upsAdvControlUpsOff = MibScalar((1, 3, 6, 1, 4, 1, 318, 1, 1, 1, 6, 2, 1), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4, 5, 6))).clone(namedValues=NamedValues(("noTurnUpsOff", 1), ("turnUpsOff", 2), ("turnUpsOffGracefully", 3), ("turnUpsSyncGroupOff", 4), ("turnUpsSyncGroupOffAfterDelay", 5), ("turnUpsSyncGroupOffGracefully", 6)))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: upsAdvControlUpsOff.setStatus('mandatory')
if mibBuilder.loadTexts: upsAdvControlUpsOff.setDescription("Setting this variable to turnUpsOff(2) causes the UPS to shut off. When in this state, the UPS will not provide output power regardless of the input line state. Setting this variable to turnUpsOffGracefully(3) causes the UPS to shut off after a delay period. This allows the host to shut down in a graceful manner. When in this state, the UPS will not provide output power regardless of the input line state. If this UPS is an active member of a Synchronized Control Group (SCG) the turnUpsSyncGroupOff(4) command will perform a Synchronized Turn Off of all active Group members regardless of their current AC output status. If this UPS is an active member of a Synchronized Control Group (SCG) the turnUpsSyncGroupOffAfterDelay(5) command will perform a Synchronized Turn Off After Delay of all active Group members regardless of their current AC output status. This unit's Shutdown Delay will be used to execute the Turn Off After Delay command. If this UPS is an active member of an SCG, the turnUpsSyncGroupOffGracefully(6) command will perform a Synchronized Turn Off Gracefully of all active Group members regardless of their current AC output status. This unit's Maximum Shutdown Time and Shutdown Delay will be used to execute the Turn Off Gracefully command. Setting this value to noTurnUpsOff(1) has no effect. The value noTurnUpsOff(1) will always be returned when the variable is read.")
upsAdvControlRebootShutdownUps = MibScalar((1, 3, 6, 1, 4, 1, 318, 1, 1, 1, 6, 2, 2), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4, 5))).clone(namedValues=NamedValues(("noRebootShutdownUps", 1), ("rebootShutdownUps", 2), ("rebootShutdownUpsGracefully", 3), ("rebootShutdownSyncGroupUps", 4), ("rebootShutdownSyncGroupUpsGracefully", 5)))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: upsAdvControlRebootShutdownUps.setStatus('mandatory')
if mibBuilder.loadTexts: upsAdvControlRebootShutdownUps.setDescription("Setting this variable to rebootShutdownUps(2) causes the UPS to shut off and turn back on (as long as good AC input power is available, otherwise the UPS will remain off until good AC input power is available). Setting this variable to rebootShutdownUpsGracefully(3) causes the UPS to shut off after a delay period and then turn back on. This allows the host to shut down in a graceful manner. If this UPS is an active member of a Synchronized Control Group (SCG) the rebootShutdownSyncGroupUps(4) command will perform a Synchronized Reboot of all active Group members regardless of their current AC output status. If applicable, this unit's Power Synchronization Delay, Shutdown Delay, Return Delay, Return Battery Capacity, and Return Battery Capacity Offset will be used to execute the Reboot command. If this UPS is an active member of a SCG the rebootShutdownSyncGroupUpsGracefully(5) command will perform a Synchronized Reboot of all active Group members regardless of their current AC output status. If applicable, this unit's Power Synchronization Delay, Maximum Shutdown Time, Shutdown Delay, Return Delay, Return Battery Capacity, and Return Battery Capacity Offset will be used to execute the Reboot command. Setting this value to noRebootShutdownUps(1) has no effect. The value noRebootShutdownUps(1) will always be returned when the variable is read.")
upsAdvControlUpsSleep = MibScalar((1, 3, 6, 1, 4, 1, 318, 1, 1, 1, 6, 2, 3), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4, 5))).clone(namedValues=NamedValues(("noPutUpsToSleep", 1), ("putUpsToSleep", 2), ("putUpsToSleepGracefully", 3), ("putUpsSyncGroupToSleep", 4), ("putUpsSyncGroupToSleepGracefully", 5)))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: upsAdvControlUpsSleep.setStatus('mandatory')
if mibBuilder.loadTexts: upsAdvControlUpsSleep.setDescription("Setting this variable to putUpsToSleep(2) causes the UPS to go to sleep for the time specified by upsAdvConfigUpsSleepTime. Setting this variable to putUpsToSleepGracefully(3) causes the UPS to go to sleep for the time specified by upsAdvConfigUpsSleepTime after a delay period. This allows the host to shut down in a graceful manner. If this UPS is an active member of a Synchronized Control Group (SCG), the putUpsSyncGroupToSleep(4) command will perform a Synchronized Sleep of all active Group members regardless of their current AC output status. This unit's Power Synchronization Delay, Shutdown Delay, Sleep Time, and Return Delay will be used to execute the sleep command. If this UPS is an active member of a SCG the putUpsSyncGroupToSleepGracefully(5) command will perform a Synchronized Sleep Gracefully of all active Group members regardless of their current AC output status. This unit's Power Synchronization Delay, Maximum Shutdown Time, Shutdown Delay, Sleep Time, and Return Delay to execute the sleep command. When in sleep mode, the UPS will not provide output power regardless of the input line state. Once the specified time has elapsed, output power will be restored. Setting this value to noPutUpsToSleep(1) has no effect. The value noPutUpsToSleep(1) will always be returned when the variable is read.")
upsAdvControlSimulatePowerFail = MibScalar((1, 3, 6, 1, 4, 1, 318, 1, 1, 1, 6, 2, 4), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2))).clone(namedValues=NamedValues(("noSimulatePowerFailure", 1), ("simulatePowerFailure", 2)))).setMaxAccess("readwrite")
