if mibBuilder.loadTexts: upsAdvControlSimulatePowerFail.setDescription('Setting this variable to simulatePowerFailure(2) causes the UPS switch to battery power. Setting this value to noSimulatePowerFailure(1) has no effect. The value noSimulatePowerFailure(1) will always be returned when the variable is read.')
upsAdvControlFlashAndBeep = MibScalar((1, 3, 6, 1, 4, 1, 318, 1, 1, 1, 6, 2, 5), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4, 5))).clone(namedValues=NamedValues(("noFlashAndBeep", 1), ("flashAndBeep", 2), ("flashAndBeepSyncGroup", 3), ("flashAndBeepCont", 4), ("flashAndBeepCancel", 5)))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: upsAdvControlFlashAndBeep.setStatus('mandatory')
if mibBuilder.loadTexts: upsAdvControlFlashAndBeep.setDescription('Setting this variable to flashAndBeep(2) causes the UPS to beep and simultaneously turn on the UPS front panel lights (Smart-UPS only). If this UPS is an active member of a Synchronized Control Group (SCG), the flashAndBeepSyncGroup(3) command will Flash and Beep all active Group members regardless of current AC output status. Setting this value to noFlashAndBeep(1) has no effect. Setting this value to flashAndBeepCont (4) commandcauses the UPS to beep and light the front panel lights until the flashAndBeepCancel (5) command is received. The value noFlashAndBeep(1) will always be returned when the variable is read.')
upsAdvControlTurnOnUPS = MibScalar((1, 3, 6, 1, 4, 1, 318, 1, 1, 1, 6, 2, 6), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3))).clone(namedValues=NamedValues(("noTurnOnUPS", 1), ("turnOnUPS", 2), ("turnOnUPSSyncGroup", 3)))).setMaxAccess("readwrite")
