if mibBuilder.loadTexts: upsAdvControlTurnOnUPS.setDescription('Setting this variable to turnOnUPS(2) causes the UPS to be turned on immediately. If this UPS is an active member of a Synchronized Control Group (SCG), the turnOnUPSSyncGroup(3) command will perform a Synchronized Turn On of all active Group members regardless of their current AC output status. Setting this value to noTurnOnUPS(1) has no effect. The value noTurnOnUPS(1) will always be returned when the variable is read.')
upsAdvControlBypassSwitch = MibScalar((1, 3, 6, 1, 4, 1, 318, 1, 1, 1, 6, 2, 7), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3))).clone(namedValues=NamedValues(("noBypassSwitch", 1), ("switchToBypass", 2), ("switchOutOfBypass", 3)))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: upsAdvControlBypassSwitch.setStatus('mandatory')
