upsAdvControlRebootUpsWithOrWithoutAC = MibScalar((1, 3, 6, 1, 4, 1, 318, 1, 1, 1, 6, 2, 8), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3))).clone(namedValues=NamedValues(("noRebootUpsWithOrWithoutAC", 1), ("rebootUpsImmediatelyWithOrWithoutAC", 2), ("rebootUpsDelayedWithOrWithoutAC", 3)))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: upsAdvControlRebootUpsWithOrWithoutAC.setStatus('mandatory')
if mibBuilder.loadTexts: upsAdvControlRebootUpsWithOrWithoutAC.setDescription('Setting this variable to rebootUpsImmediatelyWithOrWithoutAC (2) causes the UPS to turn off immediately, wait for a minimum time (typically 8 seconds), and then turn back on regardless of the AC input power on the UPS. Any supported switched outlet groups will be turned off immediately but will turn on based on their individual settings (to allow on sequencing). Setting this variable to rebootUpsDelayedWithOrWithoutAC (3) causes the UPS to turn off after a delay period, wait for a minimum time (typically 8 seconds), and then turn back on regardless of the AC input power on the UPS. Any supported switched outlet groups will be turned off and on based on their individual settings (to allow off and/or on sequencing). Setting this value to noRebootUpsWithOrWithoutAC (1) has no effect. The value noRebootUpsWithOrWithoutAC (1) will always be returned when the variable is read.')
upsAdvControlFirmwareUpdate = MibScalar((1, 3, 6, 1, 4, 1, 318, 1, 1, 1, 6, 2, 9), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3, 4, 5))).clone(namedValues=NamedValues(("noFirmwareUpdate", 1), ("firmwareUpdate", 2), ("updateInProcess", 3), ("updateSuccessful", 4), ("updateFailed", 5)))).setMaxAccess("readwrite")
if mibBuilder.loadTexts: upsAdvControlFirmwareUpdate.setStatus('mandatory')
if mibBuilder.loadTexts: upsAdvControlFirmwareUpdate.setDescription('Setting this variable to firmwareUpdate(2) causes the UPS to begin a firmware update if possible. Setting this value to noFirmwareUpdate(1) will clear the previous results, if any, or otherwise has no effect. Reading this variable will return noFirmwareUpdate(1) when the UPS firmware has not been updated (or previous results have been cleared), updateInProcess(3) when the UPS firmware is being updated, updateSuccessful(4) when the UPS firmware has been successfully updated, or updateFailed(5) if the UPS firmware update failed.')
