if mibBuilder.loadTexts: sPDUMasterControlSwitch.setDescription("Setting this OID to turnAllOnNow (1) will turn all outlets on immediately. Setting this OID to turnAllOnSequence (2) will turn all outlets on as defined by each outlet's sPDUOutletPowerOnTime OID value. Setting this OID to turnAllOff (3) will turn all outlets off immediately. Setting this OID to rebootAllNow (4) will reboot all outlets immediately. For MasterSwitch firmware version 1.X, setting this OID to rebootAllSequence (5) reboots all outlets, with power returned to the outlets in the sequence defined by each outlet's sPDUOutletPowerOnTime OID value. For MasterSwitch firmware version 2.X, setting this OID to rebootAllSequence (5) will cause a turnAllOffSequence to be performed. Once all outlets are off, the MasterSwitch will then delay the sPDUMasterConfigReboot OID time, and then perform a turnAllOnSequence. For MasterSwitch firmware version 2.X, setting this OID to turnAllOffSequence (7) will turn all outlets off as defined by each outlet's sPDUOutletPowerOffTime OID value. For MasterSwitch firmware version 1.X, setting this OID to turnAllOffSequence (7) will have no effect. Getting this OID will return the noCommand (6) value.")
sPDUMasterState = MibScalar((1, 3, 6, 1, 4, 1, 318, 1, 1, 4, 2, 2), DisplayString()).setMaxAccess("readonly")
if mibBuilder.loadTexts: sPDUMasterState.setStatus('mandatory')
if mibBuilder.loadTexts: sPDUMasterState.setDescription("Getting this OID will cause the status of all outlets to be returned. This OID is provided for informational purposes only. To change the outlet state, the user should use the sPDUOutletCtl OID in the sPDUOutletControlTable. The format of the data returned is a character string consisting of the word 'On' if the outlet is on or 'Off' if the outlet is off. At least one space will delimit each outlet entry in the string. If the outlet states are unknown, the character string 'Unknown' will be returned. This signifies that there is an inconsistency in the PDU. In the rare case that this should happen, the user is advised to shut down all equipment powered by the PDU and then cycle the PDU's power. This will put the PDU in a consistent state.")
sPDUMasterPending = MibScalar((1, 3, 6, 1, 4, 1, 318, 1, 1, 4, 2, 3), DisplayString()).setMaxAccess("readonly")
