sPDUMasterConfigPowerOn = MibScalar((1, 3, 6, 1, 4, 1, 318, 1, 1, 4, 3, 1), Integer32()).setMaxAccess("readwrite")
if mibBuilder.loadTexts: sPDUMasterConfigPowerOn.setStatus('mandatory')
if mibBuilder.loadTexts: sPDUMasterConfigPowerOn.setDescription(' The amount of delay, in seconds, between when power is provided to the PDU and when the PDU provides basic master power to the outlets. Allowed values are: -1 never apply power automatically. 0 apply power immediately. 15 apply power in 15 seconds. 30 apply power in 30 seconds. 45 apply power in 45 seconds. 60 apply power in 60 seconds (1 minute). 120 apply power in 120 seconds (2 minutes). 300 apply power in 300 seconds (5 minutes). If a value other than a supported value is provided in a set request, the PDU interprets it as the next lower acceptable value. If the provided value is lower than the lowest acceptable value, the lowest acceptable value is used.')
sPDUMasterConfigReboot = MibScalar((1, 3, 6, 1, 4, 1, 318, 1, 1, 4, 3, 2), Integer32()).setMaxAccess("readwrite")
if mibBuilder.loadTexts: sPDUMasterConfigReboot.setStatus('mandatory')
if mibBuilder.loadTexts: sPDUMasterConfigReboot.setDescription('During a reboot sequence, power is turned off and then back on. This OID defines the amount of time to wait, in seconds, after turning the power off, at the start of the sequence, before turning power back on, at the end of the reboot sequence. Allowed values are: 5 wait 5 seconds between off/on. 10 wait 10 seconds between off/on. 15 wait 15 seconds between off/on. 20 wait 20 seconds between off/on. 30 wait 30 seconds between off/on. 45 wait 45 seconds between off/on. 60 wait 60 seconds (1 minute) between off/on. If a value other than a supported value is provided in a set request, the PDU interprets it as the next lower acceptable value. If the provided value is lower than the lowest acceptable value, the lowest acceptable value is used. This OID is read-only for the MasterSwitch version 2.X and is the maximum sPDUOutletRebootDuration OID of the individual outlets.')
