if mibBuilder.loadTexts: sPDUMasterControlVMCommand.setStatus('mandatory')
if mibBuilder.loadTexts: sPDUMasterControlVMCommand.setDescription("Setting this OID to immediateAllOnVM (2) will turn all outlets on immediately. Setting this OID to immediateAllOffVM (3) will turn all outlets off immediately. Setting this OID to immediateAllRebootVM (4) will reboot all outlets immediately. Setting this OID to delayedAllOnVM (5) will turn all outlets on as defined by each outlet's sPDUOutletConfigVMPowerOnTime OID value. Setting this OID to delayedAllOffVM (6) will turn all outlets off as defined by each outlet's sPDUOutletConfigVMPowerOffTime OID value. Setting this OID to sequencedAllRebootVM (7) will cause a immediateAllOffVM command to be performed. The MasterSwitch VM will then delay the sPDUMasterStatusVMRebootDuration OID time, and then perform a delayedAllOnVM command. Setting this OID to delayedAllRebootVM (8) will cause a delayedAllOffVM command to be performed. Each outlet will then wait its sPDUOutletConfigVMRebootDuration before returning power to the outlet. Setting this OID to delayedSequenceAllRebootVM (9) will cause a delayedAllOffVM command to be performed. Once all outlets are off, the MasterSwitch VM will then delay the sPDUMasterStatusVMRebootDuration OID time, and then perform a delayedAllOnVM command. Setting this OID to cancelAllPendingCommandsVM (10) will cause all pending commands on the MasterSwitch VM to be canceled. Setting this OID to audioAlarmMute (11) will temporarily silence the audible alarm for the duration of the current overload condition. The audible alarm will be activated on subsequent overload alarms. Getting this OID will return the noCommandAllVM (1) value.")
