if mibBuilder.loadTexts: sPDUMasterControlMSPCommand.setDescription("Setting this OID to immediateAllOnMSP (2) will turn all outlets on immediately. Setting this OID to sequencedAllOnMSP (3) will turn all outlets on as defined by each outlet's sPDUOutletConfigMSPPowerOnDelay OID value. Setting this OID to immediateAllOffMSP (4) will turn all outlets off immediately. Setting this OID to gracefulAllRebootMSP (5) will reboot all outlets (after the device running PowerChute confirms shutdown) as defined by each outlet's sPDUOutletConfigMSPRebootDuration OID time value. Setting this OID to immediateAllRebootMSP (6) will reboot all outlets immediately. Setting this OID to gracefulAllShutdownMSP (7) will shutdown all outlets (after the device running PowerChute confirms shutdown) as defined by each outlet's sPDUOutletConfigMSPPowerOffDelay OID time value. Each outlet will then turn on after the sum of its sPDUOutletConfigMSPRestartDelay and sPDUOutletConfigMSPPowerOnDelay OID values. Setting this OID to overrideAllBatCapThreshMSP (8) will cause the outlet to ignore the Battery Capacity Threshold and proceed turning on the outlets as defined by each outlet's sPDUOutletConfigMSPPowerOnDelay OID value. Setting this OID to cancelAllPendingCommandsMSP (9) will cause all pending commands on the MasterSwitch plus to be canceled. Setting this OID to restoreFactoryDefaultsMSP (10) will cause the settings of the MasterSwitch plus to be restored to the factory defaults. Getting this OID will return the noCommandAllMSP (1) value.")
