if mibBuilder.loadTexts: sPDUOutletControlMSPOutletCommand.setStatus('mandatory')
if mibBuilder.loadTexts: sPDUOutletControlMSPOutletCommand.setDescription('Getting this variable will return the outlet state. If the outlet is on, the immediateOnMSP (1) value will be returned. If the outlet is off, the immediateOffMSP (3) value will be returned. Setting this variable to immediateOnMSP (1) will immediately turn the outlet on. Setting this variable to delayedOnMSP (2) will turn the outlet on after the sPDUOutletConfigMSPPowerOnDelay OID time has elapsed. Setting this variable to immediateOffMSP (3) will immediately turn the outlet off. Setting this variable to gracefulRebootMSP (4) will cause the outlet to wait for device confirmation (if applicable) and then turn the outlet off after the sPDUOutletConfigMSPPowerOffDelay OID time has elapsed. The outlet will then turn on after the sPDUOutletConfigMSPRebootDuration OID time has elapsed. Setting this variable to immediateRebootMSP (5) will immediately reboot the outlet. Setting this variable to gracefulshutdownMSP (6) will cause the outlet to wait for device confirmation (if applicable) and then turn the outlet off after the sPDUOutletConfigMSPPowerOffDelay OID time has elapsed. The outlet will then turn on after the sum of the sPDUOutletConfigMSPRestartTime OID time and the sPDUOutletConfigMSPPowerOnDelay OID time has elapsed. Setting this variable to overrideBatCapThreshMSP (7) will cause the outlet to ignore the Battery Capacity Threshold and proceed waiting on the sPDUOutletConfigMSPPowerOnDelay OID time before turning the outlet on. Setting this variable to cancelPendingCommandMSP (8) will cause any pending command to this outlet to be canceled.')
