if mibBuilder.loadTexts: rPDU2OutletSwitchedControlCommand.setDescription("Getting this variable will return the outlet state. If the outlet is on, the immediateOn (1) value will be returned. If the outlet is off, the immediateOff (2) value will be returned. If the state of the outlet cannot be determined, the outletUnknown (4) value will be returned. If the outletUnknown condition should occur, all devices powered by the PDU should be shut down. The PDU's power should then be cycled to clear this condition. Setting this variable to immediateOn (1) will immediately turn the outlet on. Setting this variable to immediateOff (2) will immediately turn the outlet off. Setting this variable to immediateReboot (3) will cause the Switched Rack PDU to perform an immediateOff command, wait the rPDU2OutletSwitchedConfigRebootDuration OID time, and then perform an immediateOn command. Setting this variable to delayedOn (5) will turn the outlet on after the rPDU2OutletSwitchedConfigPowerOnTime OID time has elapsed. Setting this variable to delayedOff (6) will turn the outlet off after the rPDU2OutletSwitchedConfigPowerOffTime OID time has elapsed. Setting this variable to delayedReboot (7) will cause the Switched Rack PDU to perform a delayedOff command, wait the rPDU2OutletSwitchedConfigRebootDuration OID time, and then perform a delayedOn command. Setting this variable to cancelPendingCommand (8) will cause any pending command to this outlet to be cancelled.")
