if mibBuilder.loadTexts: xPDUBreakerChangeEvent.setDescription('INFORMATIONAL: A system breaker or switch within the device has changed state. They are generated when any of the Q1, Q2 or Q3 breakers have changed states. The first argument is the host device serial number. The second argument is the host device name. The third argument is the breaker that has changed (1=UPS FEED (Q1), 2=UPS OUTPUT(Q2), 3=MAINTENANCE BYPASS (Q3). The fourth argument is the state of the breaker that has changed (1=OPEN, 2=CLOSED). The fifth argument is a 8-bit field representing the state of all breakers in the system, when any of one of the Q1, Q2 or Q3 breakers have changed state. The bit map is represented in the following manner (b7, b6 ... b0) b0 - UPS FEED (Q1) b1 - MAINTENANCE BYPASS (Q3) b2 - UPS OUTPUT (Q2) b3 - MAIN INPUT b4 - BYPASS INPUT b5 - CROSS-TIE OUTPUT Example: value of 60 (0x3C) indicates that the CROSS_TIE, BYPASS and MAIN INPUT, and Q2 breakers are CLOSED and Q3, Q1 breakers are OPEN.')
